import { Routes, Route } from "react-router-dom";
import './App.css';
import Home from './pages/Home';
import View from './pages/View';

function App() {
  return (
      <div>
        <Routes>
          <Route path='/' element={<Home/>} />
        </Routes>
      </div>
  );
}

export default App;
